import './App.css';
import Checkout from './Checkout';
import Header from './Header';
import Home from './Home';
import {BrowserRouter as Router,Route,Routes} from 'react-router-dom'
import { Container } from '@material-ui/core';

function App() {
  return (
    <div className="App">
      <Container>
      <Router>
        <Routes>
      <Route path='/checkout'/>
      <Header/>
      <Checkout/>
      </Routes>
      </Router>
      </Container>


    </div>
  );
}

export default App;
